    this.sortBy = function(fn, d) {
        this.v.sort(function(a, b) {
            if (!d) d = 1;
            if (a.t > b.t) return -1;
            else if (a.t < b.t) return 1;
            return fn(a, b, d);
        });
        this.sortfn = fn;
        this.sortd = d;
    };
